4.0pt;line-height:\r\n150%\">Memahami Bentuk Diagram Hubungan Antara Entitas</span></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:14.0pt;line-height:\r\n150%\">&nbsp;</span></b></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-fareast-font-family:\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\"\"=\"\"><span style=\"mso-list:Ignore\">A.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span></b><b style=\"mso-bidi-font-weight:normal\">Simbol Entity Relationship Diagram (ERD)</b></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;text-indent:42.55pt;line-height:150%\">Pada dasarnya <i style=\"mso-bidi-font-style:normal\">entity-relationship diagram </i>(ERD) berupa\r\nsketsa yang digunakan untuk menggambarkan keterkaitan antar entitas satu dengan\r\nentitas lain. <i style=\"mso-bidi-font-style:normal\">Entity Relationship Diagram\r\n</i>(ERD) digunakan oleh perancang sistem untuk memodelkan data yang akan\r\ndikembangkan menjadi database. Bentuk-bentuk mendasar dalam E-R Diagram,\r\ndiantaranya berupa kotak pesegi untuk melambangkan entitas, bentuk elips yang\r\nmelambangkan atribut, dan bentuk garis yang melambangkan hubungan (<i style=\"mso-bidi-font-style:normal\">relation</i>). Adapun simbol-simbol yang\r\ndigunakan dalam E-R Diagram sebagai berikut.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 0cm; text-align: center; line-height: 150%;\">&nbsp;<img style=\"width: 368.489px; height: 616.533px;\" src=\"data:image/png;base64,\" data-filename=\"SIM.png\"></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-fareast-font-family:\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\"\"=\"\"><span style=\"mso-list:Ignore\">B.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp; </span></span></span></b><b style=\"mso-bidi-font-weight:normal\">Diagram </b><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"mso-bidi-font-size:12.0pt;line-height:150%\">ERD dan\r\nDerajat Relationship</span></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b style=\"mso-bidi-font-weight:normal\">Diagram ERD</b></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;line-height:150%\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Entity Relationship Diagram adalah alat\r\npemodelan data utama dan akan membantu mengorganisasi data dalam suatu proyek\r\nke dalam<span style=\"mso-spacerun:yes\">&nbsp; </span>alat pemodelan data utama dan\r\nakan membantu mengorganisasi data dalam suatu proyek ke dalam entitas-entitas\r\ndan menentukan hubungan antarentitas. Proses memungkinkan analis menghasilkan\r\nstruktur basisdata yang baik sehingga data dapat disimpan dan diambil secara\r\nefisien</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;text-indent:35.4pt;line-height:150%\">Definisi ERD<span style=\"mso-spacerun:yes\">&nbsp; </span>Diagram relasi entitas atau\r\nentity-relationship diagram (ERD) adalah suatu diagram dalam bentuk gambar atau\r\nsimbol yang mengidentifikasi tipe dari entitas di dalam suatu sistem yang\r\ndiuraikan dalam data dengan atributnya, dan menjelaskan hubungan atau relasi\r\ndiantara entitas tersebut. ERD merupakan model jaringan yang menggunakan\r\nsusunan data yang disimpan dalam sistem secara abstrak. ERD berupa model data\r\nkonseptual, yang merepresentasikan data dalam suatu organisasi. ERD menekankan\r\npada struktur dan relationship data. ER diagram digunakan oleh profesional sistem\r\nuntuk berkomunikasi dengan pemakai eksekutif tingkat tinggi dalam perusahaan\r\natau organisasi<span style=\"mso-spacerun:yes\">&nbsp; </span>yang tidak tertarik pada\r\npelaksanaan operasi sistem sehari-hari, namun lebih menekankan kepada beberapa\r\nhal yaitu :</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l2 level1 lfo1\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Data apa saja yang diperlukan untuk bisnis\r\nmereka? </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l2 level1 lfo1\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Bagaimana data tersebut berelasi dengan data\r\nlainnya? </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l2 level1 lfo1\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Siapa saja yang diperbolehkan mengakses data tersebut?\r\n</p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\">Untuk\r\nmenggambarkan ER diagaram setidaknya ada tiga langkah yang harus dilakukan oleh\r\nperancang basis data yaitu: </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo3\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Menemukan atau mendefinisikan Entitas </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo3\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Menemukan atau mendefinisikan atribute </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo3\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Menemukan atau mendefinisikan Relasi </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo3\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Menggambarkan ERD menggunakan notasi-notasi\r\nstandar.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:21.3pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:35.4pt;line-height:150%\">Dalam pembentukan ERD\r\nterdapat 3 komponen yang akan dibentuk yaitu:</p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b style=\"mso-bidi-font-weight:normal\">Entitas </b></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\">Entitas adalah\r\nsesuatu yang nyata atau abstrak di mana kita akan menyimpan data. Ada 4 kelas\r\nentitas, yaitu misalnya pegawai, pembayaran, kampus, dan buku. Contoh suatu\r\nentitas disebut instansi, misalnya pegawai Adi, pembayaran Joko, dan lain sebagainya.\r\n</p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b style=\"mso-bidi-font-weight:normal\">Hubungan (relasi/relationship</b>) </p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\">Suatu hubungan\r\nadalah hubungan antara dua jenis entitas dan direpresentasikan sebagai garis\r\nlurus yang menghubungkan dua entitas.<span style=\"mso-spacerun:yes\">&nbsp; </span>Dengan\r\nkata lain relasi adalah hubungan alamiah yang terjadi antara satu atau lebih\r\nentitas,misalnya proses pembayaran pegawai. Kardinalitas menentukan kejadian\r\nsuatu entitas untuk satu kejadian pada entitas yang berhubungan. Misalnya,\r\nmahasiswa bisa mengambil banyak mata kuliah. Beberapa aturan dalam penggambaran\r\nrelasi antar entitas adalah sebagai berikut:</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l4 level1 lfo7\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Relasi dinyatakan dengan simbol belah ketupat\r\ndan nama relasi dituliskan dalam simbol belah ketupat.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l4 level1 lfo7\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Relasi menghubungkan dua entitas.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l4 level1 lfo7\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Nama relasi menggunakan kata kerja aktif yang\r\ndiawali awalan â€œ meâ€ bentuk tunggal.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l4 level1 lfo7\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Nama relasi menggunakan nama yang mudah dipahami\r\ndan memiliki makna yang jelas.</p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\">Adapun\r\nvarian-varian relasi yang dikenal dalam <i style=\"mso-bidi-font-style:normal\">entity\r\nrelationship diagram </i>(ERD) adalah sebagai berikut:</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l5 level1 lfo6\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Relasi binary termasuk jenis hubungan antar\r\nentitas yang umum digunakan. Relasi jenis ini dapat terjadi antara dua himpunan\r\nentitas yang berada. Misalnya relasi antara siswa mengambil mata peelajaran\r\nseperti berikut.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l5 level1 lfo6\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Relasi unary sering disebut dengan relasi\r\ntunggal, sebagai sebuah variasi relasi yang terjadi dari sebuah himpunan\r\nentitas ke himpunan entitas yang sama. Misalnya relasi antara â€œguruâ€ dan\r\nâ€œmendampingiâ€ yang menunjukkan bentuk relasi unary.</p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l5 level1 lfo6\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp; <span style=\"font-family: \" roboto\",=\"\" sans-serif;\"=\"\"></span></span></span></span>Relasi N-ary digunakan untuk menghubungkan tiga\r\nentitas atau lebih yang dimasukkan ke dalam relasi multi entitas. Bentuk relasi\r\nini harus dihindari karena mengaburkan derajat relasi sehingga menyebabkan\r\nperencanaan <i style=\"mso-bidi-font-style:normal\">database </i></p><p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\r\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"></m:mathFont>\r\n   <m:brkBin m:val=\"before\"></m:brkBin>\r\n   <m:brkBinSub m:val=\"--\"></m:brkBinSub>\r\n   <m:smallFrac m:val=\"off\"></m:smallFrac>\r\n   <m:dispDef></m:dispDef>\r\n   <m:lMargin m:val=\"0\"></m:lMargin>\r\n