amily:\"Times New Roman\",\"serif\";\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b style=\"mso-bidi-font-weight:normal\">Atribut</b> </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;line-height:150%\">Atribut memberikan informasi lebih rinci\r\ntentang jenis entitas. Atribut adalah ciri umum semua atau sebagian besar\r\ninstansi pada entitas tertantu. Sebutan lain atribut adalah properti, elemen\r\ndata, dan field. Misalnya nama, alamat, nomor pegawai, dan gaji adalah atribut\r\nentitas pegawai. Sebuah atribut atau kombinasi atribut yang mengidentifikasi\r\nsatu dan hanya satu instansi suatu entitas disebut kunci utama atau pengenal.\r\nMisalnya, nomor pegawai adalah kunci utama untuk pegawai. Atribut memiliki\r\nstruktur internal berupa tipe data. Jenis-jenis atribut : </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Atribut Key adalah satu atau gabungan dari\r\nbeberapa atribut yang dapat membedakan semua baris data ( Row/Record ) dalam\r\ntabel secara unik. Dikatakan unik jika pada atribut yang dijadikan key tidak\r\nboleh ada baris data dengan nilai yang sama<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;\r\n</span>Contoh : Nomor pokok mahasiswa (NPM), NIM dan nomor pokok lainnya </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Atribut simple Atribut yang bernilai atomic,\r\ntidak dapat dipecah/ dipilah lagi<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;\r\n</span>Contoh : Alamat, penerbit, tahun terbit, judul buku. </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Atribut Multivalue adalah nilai dari suatu\r\nattribute yang mempunyai lebih dari satu (multivalue) nilai dari atrribute yang\r\nbersangkutan<span style=\"mso-spacerun:yes\">&nbsp;&nbsp; </span>Contoh : dari sebuah buku,\r\nyaitu terdapat beberapa pengarang. </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family: \" roboto\",=\"\" sans-serif;\"=\"\"></span></span></span></span>Atribut Composite Atribut composite adalah suatu\r\natribut yang terdiri dari beberapa atribut yang lebih kecil yang mempunyai arti\r\ntertentu yang masih bisah dipecah lagi atau mempunyai sub attribute. Contoh :\r\ndari entitas nama yaitu nama depan, nama tengah, dan nama belakang </p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l1 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">Â·<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>Atribut Derivatif<span style=\"mso-spacerun:yes\"> </span>Atribut yang tidak harus disimpan dalam\r\ndatabase Ex. Total. atau atribut yang dihasilkan dari atribut lain atau dari\r\nsuatu relationship. Atribut ini dilambangkan dengan bentuk oval yang bergaris\r\nputus-putus </p><p>\r\n\r\n</p><p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\r\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\r\n  </w:Compatibili