iswa dan Seorang guru mengajar seorang siswa, seorang siswa diajar\r\noleh sorang guru.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img style=\"width: 214.967px; height: 109.217px;\" src=\"data:image/png;base64,\" data-filename=\"one one.png\"><span style=\"mso-no-proof:yes\"><br></span></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;mso-bidi-font-family:\r\nWingdings;mso-no-proof:yes\"><span style=\"mso-list:Ignore\">Ã¼<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-no-proof:yes\">One-to-Many</span></b><span style=\"mso-no-proof:yes\">, setiap entitas padahimpunan entitas P dapat\r\nberhubungan dengan banyak entitas pada himpunan entitas Q. namun tidak berlaku\r\nuntuk sebaliknya, setiap entitas pada himpunan entitas Q berhubungan dengan\r\npaling banyak satu entitas pada himunan entitas P. Contoh aturan bisnis: Dalam\r\nsuatu perusahaan, satu bagian memperkejakan banyak pegawai dan Satu bagian\r\nmemperkejakan banyak pegawai, satu pegawai kerja dalam<span style=\"mso-spacerun:yes\">&nbsp; </span>satu bagian.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <img style=\"width: 275.967px; height: 43.8869px;\" src=\"data:image/png;base64,\" data-filename=\"one to one.png\"><span style=\"mso-no-proof:yes\"><br></span></p><p>\r\n\r\n</p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;mso-bidi-font-family:\r\nWingdings;mso-no-proof:yes\"><span style=\"mso-list:Ignore\">Ã¼<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-no-proof:yes\">Many-to-Many</span></b><span style=\"mso-no-proof:yes\">, setiap entitas pada himpunan entitas P dapat\r\nberhubungan dengan banyak entitas pada himpunan entitas Q. hal ini berlaku\r\nuntuk sebaliknya, setiap entitas pada himpunan entitas Q dapat berhubungan\r\ndengan banyak entitas pada himpunan entitas Q. Contoh: Dalam suatu perusahaan,\r\nbanyak pegawai dipekerjakan pada satu bagian.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:49.65pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-li