r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	mso-bidi-font-size:11.0pt;\r\n	font-family:\"Times New Roman\",\"serif\";\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->Pada tiap ujung\r\ngaris yang menghubungkan kotak, kita harus menggambarkan simbol yang\r\nmenunjukkan jumlah instansi minimum atau maksimum. Simbol pertama adalah 0 atau\r\n1. Simbol 0 menunjukkan bahwa suatu entitas tidak memiliki instansi yang\r\nberhubungan dengan suatu instansi pada entitas lain yang berhubungan. Lebih\r\nLanjut, simbol 1 menunjukkan bahwa ada paling tidak satu instansi pada suatu\r\nentitas. Misalnya, lebih dari satu siswa harus terdaftar pada satu mata\r\npelajaran, tetapi mungkin pula tidak ada siswa yang memiliki guru (kalau\r\nsekolah sedang libur). Simbol kedua memberikan jumlah instansi maksimum suatu\r\nentitas yang berhubugan dengan instansi pada entitas lain yang berhubungan.\r\nJika hanya ada satu instansi, simbolnya adalah 1. Jika lebih dari satu, simbolnya\r\nadalah kaki burung yang mengarah ke kotak. </p></td></tr></tbody></table><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;line-height:150%\">\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:0cm;mso-add-space:auto;\r\ntext-align:justify;line-height:150%\"><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationK